// src/components/LogoAndBentoBoxes.js
import React from 'react';
import styled from 'styled-components';
import BarLabel from './BarLabel';
import logoImage from '../assets/final_logo-removebg-preview.png'; // Replace with your logo image
import contactPhoto1 from '../assets/contact1.jpg'; // Replace with actual image paths
import contactPhoto2 from '../assets/contact2.jpg';
import contactPhoto3 from '../assets/contact3.jpg';
import contactPhoto4 from '../assets/contact4.jpg';

const Container = styled.section`
  padding: 40px;
  text-align: center;
`;

const BentoGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(1, 1fr); /* Default single column layout */
  grid-gap: 20px;
  justify-content: center;

  @media (max-width: 1024px) {
    grid-template-columns: repeat(2, 1fr); /* Two columns layout for medium screens */
  }

  @media (min-width: 1025px) {
    grid-template-columns: repeat(4, 1fr); /* Four columns layout for large screens */
  }
`;

const BentoBox = styled.div`
  background: #fff;
  border-radius: 10px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  padding: 20px;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  text-align: center;
  transition: transform 0.3s ease, box-shadow 0.3s ease;

  &:hover {
    transform: translateY(-5px);
    box-shadow: 0 6px 12px rgba(0, 0, 0, 0.15);
  }
`;

const LogoBox = styled(BentoBox)`
  background: black url(${logoImage}) center/contain no-repeat; /* Black background with logo */
  background-size: contain; /* Ensure logo fits well */
  color: black; /* Hide text */
  font-size: 0; /* Hide text size */
  padding: 40px; /* Adjust padding as needed */
  box-shadow: none; /* Remove shadow for the logo box */
  border: 2px solid #000000; /* Optional border for the logo box */
`;

const BoxTitle = styled.h3`
  font-size: 24px;
  margin-bottom: 10px;
`;

const BoxDescription = styled.p`
  font-size: 16px;
  color: #555;
`;

const ContactBox = styled(BentoBox)`
  background: #fff;
  border-radius: 10px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  text-align: left;
`;

const ContactImage = styled.img`
  width: 80px;
  height: 80px;
  border-radius: 50%;
  margin-bottom: 15px;
`;

const ContactName = styled.h4`
  font-size: 18px;
  margin: 10px 0;
`;

function LogoAndBentoBoxes() {
  return (
    <Container>
      <BentoGrid>
        <LogoBox>
          {/* Replace with your logo */}
        </LogoBox>

        <BentoBox>
          <BoxTitle>Welcome to the database</BoxTitle>
          <BoxDescription>
            Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book...
          </BoxDescription>
        </BentoBox>

        <BentoGrid style={{ gridTemplateColumns: 'repeat(2, 1fr)' }}>
          <BentoBox>
            <BoxTitle>Surface Selection</BoxTitle>
            <BoxDescription>Description for Box 3</BoxDescription>
          </BentoBox>
          <BentoBox>
            <BoxTitle>Peptide Selection</BoxTitle>
            <BoxDescription>Description for Box 4</BoxDescription>
          </BentoBox>
        </BentoGrid>

        <BentoBox>
          <BoxTitle>Graphes</BoxTitle>
          <BoxDescription><BarLabel /></BoxDescription>
        </BentoBox>

        <BentoGrid style={{ gridTemplateColumns: 'repeat(4, 1fr)' }}>
          <ContactBox>
            <ContactImage src={contactPhoto1} alt="Contact 1" />
            <ContactName>Person 1</ContactName>
            <BoxDescription>
              Phone: +91 9429428442<br />
              Email: person1@example.com<br />
              Address: IIT Gandhinagar
            </BoxDescription>
          </ContactBox>
          <ContactBox>
            <ContactImage src={contactPhoto2} alt="Contact 2" />
            <ContactName>Person 2</ContactName>
            <BoxDescription>
              Phone: +91 9429428443<br />
              Email: person2@example.com<br />
              Address: IIT Gandhinagar
            </BoxDescription>
          </ContactBox>
          <ContactBox>
            <ContactImage src={contactPhoto3} alt="Contact 3" />
            <ContactName>Person 3</ContactName>
            <BoxDescription>
              Phone: +91 9429428444<br />
              Email: person3@example.com<br />
              Address: IIT Gandhinagar
            </BoxDescription>
          </ContactBox>
          <ContactBox>
            <ContactImage src={contactPhoto4} alt="Contact 4" />
            <ContactName>Person 4</ContactName>
            <BoxDescription>
              Phone: +91 9429428445<br />
              Email: person4@example.com<br />
              Address: IIT Gandhinagar
            </BoxDescription>
          </ContactBox>
        </BentoGrid>
      </BentoGrid>
    </Container>
  );
}

export default LogoAndBentoBoxes;
